import React from "react";

function TopicHeaderText({ topic }) {
    return (
        <section className="flex overflow-hidden flex-col items-center py-28 pr-11 pl-12 w-full bg-gradient-to-r from-blue-500 to-purple-500 shadow-lg rounded-lg max-md:px-5 max-md:py-24 max-md:max-w-full">
            <div className="flex flex-col max-w-full text-center text-white w-[768px]">
                <h1 className="text-6xl font-bold leading-tight max-md:max-w-full max-md:text-4xl">
                    {topic}
                </h1>
            </div>
        </section>
    );
}

export default TopicHeaderText;
